import React from 'react';

function Nav() {
  return (
    <nav>
      <ul>
        <li>
          // eslint-disable-next-line
          <a href="#" active>Shortly</a>
        </li>
        <li>
          <a href="#">Features</a>
        </li>
        <li>
          <a href="#">Pricing</a>
        </li>
        <li>
          <a href="#">Resources</a>
        </li>
      </ul>
    </nav>
  )
}

export default Nav;
